            </div> */}

            <form class="form-collector container" action="#" method="POST">
                <input className=""
                    type="text" name="markerCount"
                    value={searchField}
                    id="markerCount"
                    placeholder="Generate weather points"
                    onChange={handleInputChange} />

                <button id="formBtn" onClick={handleFormSubmit}>Search</button>
            </form>

        </Fragment>
    )

}

export default SearchBar;
